import React from "react";
import { Container, Row, Col } from "react-bootstrap";
const Form: React.FC<any> = () => {
  return (
    <Container>
      <Row>
        <Col>
          <div className="panel">
            <div className="panel__header">
              <h2 className="panel__header-title">Dashboard</h2>
            </div>
            <div className="panel__body">
              <p>No records added.</p>
            </div>
          </div>
        </Col>{" "}
      </Row>{" "}
      <Row>
          <Col>
          <Button variant="primary" href="/form">Issue Cheque</Button>
          </Col>
      </Row>
    </Container>
  );
};

export default Form;
